import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container
  } from "@mui/material";

  function HomePage() {
    return (
      <Container
        fixed
        sx={{
          bgcolor: "black",
          marginTop: '10vh', 
          width: "100%",
          marginLeft: "0",
          marginRight: "0",
        }}
      >
        <Box sx={{ pt: "10px" }}>
          <Box name='left'></Box>
          <Box name='right'></Box>
        </Box>
      </Container>
    );
  }

  export default HomePage;
